import React from "react";
import PicContainer from "../PicContainer/PicContainer";
import "./DishesHome.scss";
import padKiMao from "../../assets/dishes/pad-ki-mao@2x.png";
import garbanzo from "../../assets/dishes/garbanzo-frito.png";
import smokedPizza from "../../assets/dishes/smoked-pizza.png";
import spicyIcon from "../../assets/icons/spicy-icon.png";
import veganIcon from "../../assets/icons/vegan-icon.png";

const DISHES = [
  {
    pic: padKiMao,
    name: "Pad Ki Mao",
    text: "Shrimps, Glass Noodles, Kemiri Nuts, Shallots, Lemon Grass, Magic Chili Brown Coconut",
    icons: [spicyIcon],
    price: "₪88",
    rest: "Tiger Lilly",
  },
  {
    pic: garbanzo,
    name: "Garbanzo Frito",
    text: "Polenta fingers, veal cheek,magic chili cured lemon cream, yellow laksa",
    icons: [],
    price: "₪98",
    rest: "Kab Kem",
  },
  {
    pic: smokedPizza,
    name: "Smoked Pizza",
    text: 'Basil dough, cashew "butter", demi-glace, bison & radish',
    icons: [veganIcon],
    price: "₪65",
    rest: "Popina",
  },
];

const DishesHome = () => {
  return (
    <div className="dishes-home-container">
      <div className="dishes-home-title">SIGNATURE DISH OF :</div>
      <div className="dishes-home">
        {DISHES.map((dish, index) => {
          return (
            <div className="dishes-home-dish">
              <span className="dishes-home-rest">{dish.rest}</span>
              <PicContainer
                key={index}
                type="dish-home"
                pic={dish.pic}
                title={dish.name}
                text={dish.text}
                icons={dish.icons}
                price={dish.price}
                id={index}
              />
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default DishesHome;
